import React, { useState } from 'react';
import { useDispatch } from 'react-redux';
import { createProject } from '../actions/projectActions';
import { createExperience } from '../actions/experienceActions';
import { createThought } from '../actions/thoughtActions';
import { updateSidebarInfo } from '../actions/SidebarActions';
import './AdminPage.css';

const AdminPage = () => {
  const dispatch = useDispatch();
  const [project, setProject] = useState({ title: '', description: '', photos: [], link: '' });
  const [experience, setExperience] = useState({ description: '', photo: '', link: '' });
  const [thought, setThought] = useState({ text: '' });
  const [sidebarInfo, setSidebarInfo] = useState({ description: '', image: '' });

  const handleProjectSubmit = (e) => {
    e.preventDefault();
    dispatch(createProject(project));
    setProject({ title: '', description: '', photos: [], link: '' });
  };

  const handleExperienceSubmit = (e) => {
    e.preventDefault();
    dispatch(createExperience(experience));
    setExperience({ description: '', photo: '', link: '' });
  };

  const handleThoughtSubmit = (e) => {
    e.preventDefault();
    dispatch(createThought(thought));
    setThought({ text: '' });
  };

  const handleSidebarInfoSubmit = (e) => {
    e.preventDefault();
    dispatch(updateSidebarInfo(sidebarInfo));
    setSidebarInfo({ description: '', image: '' });
  };

  return (
    <div className="admin-page">
      <h1>Admin Panel</h1>

      <form onSubmit={handleProjectSubmit}>
        <h2>Add Project</h2>
        <input
          type="text"
          placeholder="Project Title"
          value={project.title}
          onChange={(e) => setProject({ ...project, title: e.target.value })}
        />
        <textarea
          placeholder="Project Description"
          value={project.description}
          onChange={(e) => setProject({ ...project, description: e.target.value })}
        ></textarea>
        <input
          type="text"
          placeholder="Project Link"
          value={project.link}
          onChange={(e) => setProject({ ...project, link: e.target.value })}
        />
        <input
          type="file"
          multiple
          onChange={(e) => setProject({ ...project, photos: Array.from(e.target.files).map(file => URL.createObjectURL(file)) })}
        />
        <button type="submit">Add Project</button>
      </form>

      <form onSubmit={handleExperienceSubmit}>
        <h2>Add Experience</h2>
        <textarea
          placeholder="Experience Description"
          value={experience.description}
          onChange={(e) => setExperience({ ...experience, description: e.target.value })}
        ></textarea>
        <input
          type="text"
          placeholder="Experience Link"
          value={experience.link}
          onChange={(e) => setExperience({ ...experience, link: e.target.value })}
        />
        <input
          type="file"
          onChange={(e) => setExperience({ ...experience, photo: URL.createObjectURL(e.target.files[0]) })}
        />
        <button type="submit">Add Experience</button>
      </form>

      <form onSubmit={handleThoughtSubmit}>
        <h2>Add Thought</h2>
        <textarea
          placeholder="Your Thought"
          value={thought.text}
          onChange={(e) => setThought({ ...thought, text: e.target.value })}
        ></textarea>
        <button type="submit">Add Thought</button>
      </form>

      <form onSubmit={handleSidebarInfoSubmit}>
        <h2>Edit General Info</h2>
        <textarea
          placeholder="General Info Description"
          value={sidebarInfo.description}
          onChange={(e) => setSidebarInfo({ ...sidebarInfo, description: e.target.value })}
        ></textarea>
        <input
          type="file"
          onChange={(e) => setSidebarInfo({ ...sidebarInfo, image: URL.createObjectURL(e.target.files[0]) })}
        />
        <button type="submit">Update General Info</button>
      </form>
    </div>
  );
};

export default AdminPage;
